const ChartBlock = () => {
    return (
        <div className={Styles.ChartBlock}>
            <div className={Styles.chart__info}>
                <div className={Styles.info_title}>
                    Атак больше,<br/>
                    защита дороже
                </div>
                <div className={Styles.info_title}>
                    Атак больше,<br/>
                    защита дороже
                </div>
            </div>
            <div className={Styles.Chart__img}></div>
        </div>
    );
};

export default ChartBlock;
